import {Component} from 'react';
import './users.css';

import Signup from './signup';
import Login from './login';

class Users extends Component{

    state = {
        current_component_being_rendered: <Login />, 
        button_under_form_text: "Don't have an account yet? Sign up here"
    }
    
    handleClick = (event) => {
        console.log('here')
        event.preventDefault()
        if (this.state.current_component_being_rendered === <Login />){
            this.setState({
                current_component_being_rendered: <Signup />,
                button_under_form_text: "Already have an account? Log in here"
            })
        }
        else if (this.state.current_component_being_rendered === <Signup />){
            this.setState({
                current_component_being_rendered: <Login />,
                button_under_form_text: "Don't have an account yet? Sign up here"
            })
        }
    }

    render(){
        return(
            <div>
                {this.state.current_component_being_rendered}
                <p id="fake_link_text" onClick={event => this.handleClick(event)}>{this.state.button_under_form_text}</p>
            </div>
        )
    }
}

export default Users;
